import React from 'react';
import {StyleSheet, View} from "react-native";

const Square = ({color}) => {
    return (
        <View style={[styles.box, {backgroungColor: color}]}></View>
    );
};

const styles = StyleSheet.create({
   box: {
       width: 100,
       height: 100
   }
})

export default Square;
